// src/components/ParallaxComponent.js
import React, { useEffect } from 'react';
import './ParallaxComponent.css';

const ParallaxComponent = () => {
  useEffect(() => {
    const handleScroll = () => {
      const parallax = document.querySelectorAll('.parallax');
      parallax.forEach((element) => {
        let offset = window.pageYOffset;
        element.style.backgroundPositionY = `${offset * 0.5}px`;
      });
    };

    window.addEventListener('scroll', handleScroll);
    return () => window.removeEventListener('scroll', handleScroll);
  }, []);

  return (
    <div className="parallax-container">
      <div className="parallax parallax-image1">
        <h2>Parallax Section 1</h2>
      </div>
      <div className="content-section">
        <h2>Scroll Down</h2>
        <p>Some content here...</p>
      </div>
      <div className="parallax parallax-image2">
        <h2>Parallax Section 2</h2>
      </div>
      <div className="content-section">
        <h2>More Content</h2>
        <p>Some more content here...</p>
      </div>
    </div>
  );
};

export default ParallaxComponent;
